import React, { useState } from 'react';
const {  Modal, Button  } = antd;

const DialogCard = (props) => {


    return(<>
    
    <Modal
          title="20px to Top"
          style={{ top: 20 }}
          visible={props.modal1Visible}
          onOk={() => props.setModal1Visible(false)}
          onCancel={() => props.setModal1Visible(false)}
        ><p>some contents...</p>
        <p>some contents...</p>
        <p>some contents...</p>
      </Modal>
    
    
    
    </>)

}
export default DialogCard;
